            "title": "DRDO Sponsored Workshop on Quantum Computing",
            "description": "Quantum Computation represents an important\r\nchange of paradigm, where the concept of bit\r\ngets transformed into a quantum bit, or qubit, which affords for an enormous information stor-\r\nage and processing capacity. In this program, organized by the Indian Institute of Information\r\nTechnology the basic concepts of Quantum\r\nComputation will be introduced at a conceptual\r\nlevel. An abundant set of exercises will allow to\r\nacquire sufficient skill to develop your own\r\nquantum algorithms and circuits. The course\r\nwill take place at IIIT Kota from 21th to 25th of\r\nJan 2022 and is aimed at researchers, teachers\r\nstudents and industrialists. Participation in this workshop is open to faculty members/PhD Scholars/PG Students and people\r\nfrom industry. Since the number of seats are\r\nlimited to 100, the selection will be made on\r\nfirst come first serve basis and intimation will be sent to the candidates through email. Certifi-\r\ncates will be issued to the participants only after attending the complete course.",
