            "title": "Workshop on “The significance of Ayurveda in contemporary times”",
            "description": "Women's Cell, IIIT Kota, MNIT Jaipur campus hosted a seminar on “The significance of\r\nAyurveda in contemporary times” on 26th September, 2022. Dr. Hetal Harishbhai Dave was\r\ninvited to deliver a lecture that would educate everyone about the same.\r\nThrough her lecture Dr. Hetal Harishbhai Dave focus on the evolutionary history of ayurveda\r\nand local health traditions. An Ayurvedic treatment plan focuses on restoring your doshas\r\nthrough a combination of diet, exercise, massage, Ayurvedic products, yoga and meditation.\r\nThis multi-pronged approach provides a greater opportunity for healing and overall wellness.\r\nAyurvedic medicine aims at maintaining and restoring body’s own capability to have balance\r\nand fight with ailments. Ayurveda is from nature itself; the nature contains many useful\r\nplants and trees which has the ability to cure almost every disease which is facing by\r\nmankind. It has the distinction of being the oldest medical system known to man and the\r\noldest and most comprehensive spiritual teachings in the world. It is based on the principle of\r\nmaintaining a balance between the interrelated relationships within the body and mind. It\r\noriginated in India and has evolved there over thousands of years. By the proper balance of\r\nall vital energies in the body, the processes of physical deterioration and disease can be\r\nreduced. This is accomplished through proper eating, thinking and living habits as well as the\r\nuse of herbal remedies to treat illness.\r\nThe lecture on the importance of Ayurveda and its part in women's health was both\r\neducational and entertaining. Everyone's understanding of Ayurveda and the critical role it\r\ncan play in enhancing the human body, especially in women, was enhanced by the\r\ndiscussion.",
