            "title": "Upnayan: Induction Program -2024",
            "description": "The first-year orientation at IIIT Kota played a crucial role in setting the stage for the incoming class of 2024. Held over the course of several days in mid August 2024, the orientation program was designed to immerse the new students in the vibrant academic and social fabric of the institute.\r\n\r\nDuring the orientation, the new students were warmly welcomed by the IIIT Kota community, including the esteemed faculty, senior peer mentors, and student leaders. Through a series of interactive sessions and informative presentations, the new students gained a comprehensive understanding of the institute's academic programs, course structures, and degree requirements.\r\n\r\nOne of the highlights of the orientation was the opportunity for students to engage directly with faculty members from each department. These personalized interactions allowed the new students to learn about the diverse research areas and specialized courses offered at IIIT Kota, helping them make informed decisions about their academics.\r\n\r\nIn addition to the academic focus, students were introduced to the wide range of student clubs that thrive on campus. The new class was encouraged to explore their interests and get involved in activities that complemented their academic pursuits.\r\n\r\nThe orientation also served as a platform for the incoming students to connect with their senior peers. Senior students shared valuable insights and guidance, offering a smooth transition for the new students.\r\n\r\nOverall, the first-year orientation at IIIT Kota was a success, providing the class of 2024 with a robust introduction to the institute's vibrant academic environment, diverse extracurricular opportunities, and supportive community.",
