            "title": "Workshop on \"Foundation of AI for HPC and HPC for AI\"",
            "description": "Dr. VCV Rao, Consultant in C-DAC, Pune on National Supercomputing Mission visited IIIT Kota and the one day workshop held on 14-Sep-2024. The workshop explores the intersection on High-Performance Computing (HPC) and Artificial Intelligence (AI), focusing on how these technologies enhance each other. It covered the foundational concepts, practical applications, and emerging trends in leveraging HPC for AI and vice versa. The key topics such as GPU, Accelerated Processing Unit, Combination of Low level and High level APIs, Workflows, Framework, AI Sys, AI compilers and AI accelerators were discussed. Participants gained a comprehensive understanding of how HPC and AI can be synergistically combined to address complex problems and drive innovation. The workshop emphasized the transformative potential of integrating HPC with AI and provided participants with the skills to leverage these technologies for advanced computing and data analysis.",
