            "title": "Swachhata Hi Seva -2024",
            "description": "As part of the Swachhata Ki Bhaagidari pillar of the Campaign \"Swachhata Hi Seva -2024\", IIIT Kota organized Slogan Writing, Painting Competition, and Swachhata Quiz activities at Government School, Ranpur, Kota. The event was organized under the guidance of Prof. K.K. Sharma, Coordinator, IIITKota, and Prof.H.S. Mali, Dean, Student Welfare and Wellness & Health, IIITKota, along with their team, which included event coordinators Dr. Veena Khandelwal and Dr. Rahul Makkad, as well as student volunteers from IIIT Kota's CACS Club. More than 200 students from the school participated actively in various competitions. The program was successful in drawing students' attention to the need for cleanliness in their school. The event also encouraged students to share their ideas about cleanliness and sanitation in creative ways, as well as tested students' knowledge and understanding of the topics. Stationery materials and drawing sheets for the painting competition were also distributed to the students.",
